import React from 'react';
import Todo from './Todo';
import { TodoItem } from './todo.model';

interface TodoListProps {
   todos: TodoItem[],
}

  

const TodoList = ({todos}:TodoListProps) => {
    return (
      <div>
         {
            todos.map((todo) => (
               <Todo/>
               ))
         }
         
      </div>
    );
};

export default TodoList;
